        public static void InitializeMenu()
        {
            StringMenu = new Menu("stringmenu", "Renderer.DrawText(); options")
            {
                Components.StringComponent.DrawTheString.SetToolTip("Enabling this, will draw all the string..."),
                Components.StringComponent.DrawStringColor,
                Components.StringComponent.DrawStringSize.SetToolTip("Dynamic strings would come with different size..."),
                Components.StringComponent.DrawStringPosY,
                Components.StringComponent.DrawStringOptions,
                Components.StringComponent.DrawStringSeparator.SetToolTip("Setting a tooltip to a Label, how original is that..."),
                Components.StringComponent.DrawStringSeparatorEmpty,
                Components.StringComponent.DrawStringOrient,
                Components.StringComponent.DrawStringShadow.SetToolTip("KeyBindType.Toggle and KeyBindType.Hold are your two options to trigger the bool"),
                Components.StringComponent.DrawStringLabel1,
                Components.StringComponent.DrawStrWithBg,
            };
            SquareMenu = new Menu("squaremenu", "Renderer.DrawFilledRect(); Renderer.DrawRect(); options")
            {
                Components.SquaresComponent.DrawTheSquares,
                Components.SquaresComponent.DrawRectCol,
                Components.SquaresComponent.DrawRectSize,
                Components.SquaresComponent.DrawRectWidth,
            };
            LinesMenu = new Menu("linesmenu", "Renderer.DrawLines(); Renderer.DrawLine(); options")
            {
                Components.LinesComponent.DrawTheLines,
                Components.LinesComponent.DrawLinesColor,
                Components.LinesComponent.DrawLinesWidth,
                Components.LinesComponent.DrawPtsCnt,
                Components.LinesComponent.DrawLinesAA,
            };
            CircleMenu = new Menu("circlemenu", "Renderer.DrawCircle(); options")
            { 
                Components.CirclesComponent.DrawTheCircles,
                Components.CirclesComponent.DrawCircleCol,
                Components.CirclesComponent.DrawCircleRad,
                Components.CirclesComponent.DrawCircleWid,
                Components.CirclesComponent.DrawCircleAA,
                Components.CirclesComponent.DrawCircleQ.SetToolTip("Circles are built from lines, the more lines it's built from - the better quality - the more resources it uses from the system..."),
            };
            SpriteMenu = new Menu("spritemenu", "Renderer.DrawSprite(); options")
            {
                Components.SpriteComponent.DrawTheSprites,
                Components.SpriteComponent.DrawSpriteCol,
                Components.SpriteComponent.DrawSpriteRad,
                Components.SpriteComponent.DrawSpriteScale,
                Components.SpriteComponent.DrawBottomRight,
                Components.SpriteComponent.SpriteSep1,
                Components.SpriteComponent.DrawDarkGreenCircle,
                Components.SpriteComponent.ForceRedOnCircle,
            };
            FPSBoxMenu = new Menu("fpsboxmenu", "Renderer.DrawFPSBox(); options")
            {
                Components.BOXComponent.DrawTheBox,
                Components.BOXComponent.DrawBoxColor,
                Components.BOXComponent.DrawStringOptions,
                Components.BOXComponent.DrawBoxThickness,
                Components.BOXComponent.DrawBoxBorder,
                Components.BOXComponent.DrawSepBox,
                Components.BOXComponent.DrawBoxHP,
                Components.BOXComponent.DrawBoxMP,
                Components.BOXComponent.DrawBoxFntSize,
                Components.BOXComponent.DrawBoxDist,
                Components.BOXComponent.DrawBoxWeap,
                Components.BOXComponent.DrawBoxName,
                Components.BOXComponent.DrawBoxClan,
                Components.BOXComponent.DrawBoxPing,
            };



            Root = new Menu("apiexample", "WeScript.Drawing.Example Assembly API", true)
            {
                Components.MainAssemblyToggle.SetToolTip("The magical boolean which controls the whole assembly code!"),
                StringMenu,
                SquareMenu,
                LinesMenu,
                CircleMenu,
                SpriteMenu,
                FPSBoxMenu,
            };

            Root.Attach();
        }

