        {
            ImageConverter converter = new ImageConverter();
            return (byte[])converter.ConvertTo(img, typeof(byte[]));
        }

        static void Main(string[] args)
        {
            InitializeMenu();
            Renderer.OnRenderer += Renderer_OnRenderer;
            Console.WriteLine("WeScript.app Drawing, Menu examples loaded with success!");
            var bitmap = (Bitmap)Resources.ResourceManager.GetObject("RandomPic"); //locate our resource (it's not a real BMP)
            imageBytesFromOurResource = ImageToByte(bitmap); //put our resource to a byte array
            imageIndex = Renderer.CreateSprite(imageBytesFromOurResource, imageBytesFromOurResource.Length); //create our sprite "once" when the assembly gets loaded, we need to get a (imageIndex > 0)
            imageIndex2 = Renderer.CreateSprite(imagePngCircleBytes, imagePngCircleBytes.Length); //create a sprite directly from a "pre-defined byte array"
        }

        private static void Renderer_OnRenderer(int fps, EventArgs args)
        {
            if (!Components.MainAssemblyToggle.Enabled) return; //don't draw anything if main toggle is disabled

            if (Components.StringComponent.DrawTheString.Enabled)
            {
                Renderer.DrawText(Components.StringComponent.DrawStringOptions.SelectedItem, 100, Components.StringComponent.DrawStringPosY.Enabled ? Components.StringComponent.DrawStringPosY.Value : 0, Components.StringComponent.DrawStringColor.Color, Components.StringComponent.DrawStringSize.Value, (TextAlignment)Components.StringComponent.DrawStringOrient.Value, Components.StringComponent.DrawStringShadow.Enabled);
                //^string with all possible options available in a menu
                if (Components.StringComponent.DrawStrWithBg.Enabled)
                {
                    var textPixels = Renderer.GetTextWidth("TestingStringWithBackground | 𝒞vllum カルム // ｓｅｒｅｎｉｔｙ", 24);
                    Renderer.DrawFilledRect(new Vector2(300, 300), textPixels, new SharpDX.Color(0, 0, 255, 50));
                    //^First draw the background
                    Renderer.DrawText("TestingStringWithBackground | 𝒞vllum カルム // ｓｅｒｅｎｉｔｙ", 300, 300, new SharpDX.Color(255, 255, 255, 255), 24); //unicode support is nice
                    //^string with size of 24, on screenCoords(300,300) with blue background fill behind it
                }
            }

            if (Components.SquaresComponent.DrawTheSquares.Enabled)
            {
                var positioning = new Vector4(200, 200, Components.SquaresComponent.DrawRectSize.Value, Components.SquaresComponent.DrawRectSize.Value);
                Renderer.DrawRect(positioning, Components.SquaresComponent.DrawRectWidth.Value ,Components.SquaresComponent.DrawRectCol.Color);
                var positioning2 = new Vector4(200, 410, Components.SquaresComponent.DrawRectSize.Value, Components.SquaresComponent.DrawRectSize.Value);
                Renderer.DrawFilledRect(positioning2, Components.SquaresComponent.DrawRectCol.Color);
            }

            if (Components.LinesComponent.DrawTheLines.Enabled)
            {
                float[] myXYPointsOnScreen =
                    { 33.0f, 22.0f, //1
                    70.0f, 140.0f, //2
                    25.0f, 77.0f, //3
                    193.0f, 20.0f, //4
                    10.0f , 44.0f}; //5
                Renderer.DrawLines(myXYPointsOnScreen, (uint)Components.LinesComponent.DrawPtsCnt.Value, Components.LinesComponent.DrawLinesColor.Color, Components.LinesComponent.DrawLinesWidth.Value, Components.LinesComponent.DrawLinesAA.Enabled);
                var startPoint = new Vector2(0, (Renderer.ScreenResolutionY / 4));
                var endPoint = new Vector2((Renderer.ScreenResolutionX / 4), 0);
                Renderer.DrawLine(startPoint, endPoint, Components.LinesComponent.DrawLinesColor.Color, Components.LinesComponent.DrawLinesWidth.Value, Components.LinesComponent.DrawLinesAA.Enabled);
            }

            if (Components.CirclesComponent.DrawTheCircles.Enabled)
            {
                Renderer.DrawCircle(500, 500, Components.CirclesComponent.DrawCircleRad.Value, Components.CirclesComponent.DrawCircleWid.Value, Components.CirclesComponent.DrawCircleAA.Enabled, Components.CirclesComponent.DrawCircleQ.Value, Components.CirclesComponent.DrawCircleCol.Color);
            }

            if (Components.SpriteComponent.DrawTheSprites.Enabled)
            {
                if (imageIndex > 0) //before drawing, make sure it was actually created
                {
                    if (!Components.SpriteComponent.DrawBottomRight.Enabled)
                    {
                        Renderer.DrawSprite(imageIndex, (Renderer.ScreenResolutionX / 2 - 150), 20, Components.SpriteComponent.DrawSpriteCol.Color, Components.SpriteComponent.DrawSpriteRad.Value, Components.SpriteComponent.DrawSpriteScale.Enabled ? (Components.SpriteComponent.DrawSpriteScale.Value * 0.01f) : 1.0f);
                    }
                    else
                    {
                        //pic is 256x256; we will draw only bottom right quarter of it, starting from inside (the center, which is at 128,128) and the rest of the image size which again is 128,128
                        Renderer.DrawSprite(imageIndex, (Renderer.ScreenResolutionX / 2 - 150), 20, Components.SpriteComponent.DrawSpriteCol.Color, Components.SpriteComponent.DrawSpriteRad.Value, Components.SpriteComponent.DrawSpriteScale.Enabled ? (Components.SpriteComponent.DrawSpriteScale.Value * 0.01f) : 1.0f,128,128,128,128);
                    }
                }
                if (imageIndex2 > 0) //before drawing, make sure it was actually created
                {
                    if (Components.SpriteComponent.DrawDarkGreenCircle.Enabled)
                    {
                        Renderer.DrawSprite(imageIndex2, (Renderer.ScreenResolutionX / 4 + 100), 20, Components.SpriteComponent.ForceRedOnCircle.Enabled ? new SharpDX.Color(255, 0, 0, 255) : new SharpDX.Color(255, 255, 255, 255));
                    }
                }
            }

            if (Components.BOXComponent.DrawTheBox.Enabled)
            {
                var imaginaryHeadPos = new Vector2((Renderer.ScreenResolutionX / 2), (Renderer.ScreenResolutionY / 2 - 100));
                var imaginaryFeetPos = new Vector2((Renderer.ScreenResolutionX / 2), (Renderer.ScreenResolutionY / 2 + 100));
                Renderer.DrawFPSBox(imaginaryHeadPos, imaginaryFeetPos, Components.BOXComponent.DrawBoxColor.Color, (BoxStance)Components.BOXComponent.DrawStringOptions.Value,Components.BOXComponent.DrawBoxThickness.Value,Components.BOXComponent.DrawBoxBorder.Enabled,Components.BOXComponent.DrawSepBox.Enabled,Components.BOXComponent.DrawBoxHP.Value, Components.BOXComponent.DrawBoxHP.Enabled ? 100 : 0, Components.BOXComponent.DrawBoxMP.Value, Components.BOXComponent.DrawBoxMP.Enabled ? 100 : 0, Components.BOXComponent.DrawBoxFntSize.Value, Components.BOXComponent.DrawBoxDist.Enabled ? "Distance [47.2]" : "", Components.BOXComponent.DrawBoxWeap.Enabled ? "Weapon [AK-47]" : "", Components.BOXComponent.DrawBoxName.Enabled ? "Name [John Doe]" : "", Components.BOXComponent.DrawBoxClan.Enabled ? "Clan [Sniper Elite]" : "", Components.BOXComponent.DrawBoxPing.Enabled ? "Ping [80ms]" : "");
            }
        }
    }
}
